import { CloseModalCrossStyled } from './CloseModalCross.styled';
import { closeModal } from '../../redux/modal/modalSlice';
import { Close } from 'assets/fonts/images/icons/Close';

export const CloseModalCross = () => {
  return (
    <CloseModalCrossStyled type="button" onClick={closeModal}>
      <Close />
    </CloseModalCrossStyled>
  );
};
